import "./Typewriter.css";
import TypewriterEffect from 'typewriter-effect';

function Typewriter() {
    return (
        <TypewriterEffect
  onInit={(typewriter) => {
    typewriter.typeString('Hello World!')
      .callFunction(() => {
        console.log('String typed out!');
      })
      .pauseFor(2500)
      .deleteAll()
      .callFunction(() => {
        console.log('All strings were deleted');
      })
      .start();
  }}
/>)
}

export default Typewriter;
